import React, {Component} from 'react'
import { Text, View, StatusBar, StyleSheet } from 'react-native'
import { Button } from 'react-native-elements';
import { SafeAreaProvider, SafeAreaView } from 'react-native-safe-area-context';
import Ionicons from 'react-native-vector-icons/Ionicons';
import Icon from 'react-native-vector-icons/FontAwesome';

import firebase from 'firebase'

class Account extends Component {
    constructor(props) {
        super(props);
    }

    signOut() {
        firebase.auth().signOut()
          .catch((error) => {
            console.log(error);
          })
    }

    render() {
        return(
            <View style={webStyles.body}>
                <Text>Logged In</Text>
                <Button icon={<Icon name="arrow-right" size={15} color="white"/>} title="SIGN OUT" onPress={() => this.signOut()}  titleStyle={{color: "rgb(68, 199, 188)"}} buttonStyle={webStyles.signOutButton}></Button>
                <StatusBar style="auto" backgroundColor="rgb(68, 199, 188)" barStyle="dark-content" />
            </View>
        )
    }

}

var webStyles = StyleSheet.create({
    body: {
        backgroundColor: "white",
        height: "100%",
        padding: 20,
    },
    signOutButton: {
        "backgroundColor": "transparent",
        borderWidth: 1,
        borderColor: "rgb(68, 199, 188)",
    },
});

export default Account;
